import React from 'react'

const Serch = () => {
    return (
        <div className="serchbar" >
            const Input = ({ inputType, inputVal, setInputVal }) => (
              <input
                type={inputType}
                value={inputVal}
                onChange={e => setInputVal(e.target.value)}
              />
            );
            
        </div>
    )
}

export default Serch;
